		//פונקציה לחישוב הציון הסופי
		function scoreCalc() {
			for (i = 0; i < ansStatus.length; i++) {
				//חישוב הציון הסופי
				score += Math.floor((100 / ((ansStatus.length) * (ansStatus[i]))));
				//חישוב מספר השגיאות
				//להוסיף גם תנאי- אם הגיע מסך "נגמר הזמן", להוסיף עוד נקודה למספר השגיאות
				mistakes += (ansStatus[i] - 1);
				console.log("מס ניסיונות המענה בכל תא: " + ansStatus[i]);
			}
			console.log("ציון: " + score);
			console.log("שגיאות: " + mistakes);
		}
		
